import React from 'react';
import './Footer.css'

function Footer() {
    return (
        <div className="footerContainer">
            <div className="leftFooter">
                <h5>Call Us</h5>
            </div>
            <div className="centerFooter">
                <h5>Visit Us</h5>
               <p>Phone:</p>
            </div>
            <div className="rightFooter">
                <h5>Map</h5>
            </div>
            
        </div>
    );
}

export default Footer;
